import { User, Point } from "./Inferfaces";


function TypeScriptForJsProgrammers() {
  const user: User = {
    name: "Divine",
    id: 0,
  };

  return <div>{`${user.name} and ${user.id}`}</div>;
}

export function LogPoint(p:Point){
  return <div>{`${p.x}, ${p.y}`}</div>
}



export default TypeScriptForJsProgrammers;
